import { useState } from "react";

const SignUp = () => {
  const [signUpFormState, setSignUpFormState] = useState({
    fullName: {
      value: "",
      type: "text",
      valid: {
        min: 3,
        max: 20,
      },
    },
    nickName: {
      value: "",
      type: "text",
      valid: {
        min: 3,
        max: 20,
      },
    },
    password: {
      value: "",
      type: "password",
      valid: {
        min: 6,
        max: 20,
      },
    },
  });

  let signUpForm = (
    <form>
      <h1>SIGN UP</h1>
      {Object.entries(signUpFormState).map(([key, value]) => {
        return( <input type={value.type} value={value.value} />)
      })}
      ;
    </form>
  );

  return <div>{signUpForm}</div>;
};

export default SignUp;
